import { OmitProps } from 'antd/lib/transfer/ListBody'
import React from 'react'

const ListTable = () => {
  return (
    <Table
      bordered
      rowKey="_id"
      columns={columns}
      dataSource={OmitProps.employees}
      pagination={{ defaultPageSize: PAGE_SIZE }}
    />
  )
}
export default ListTable
